import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Dashboard from "./pages/Dashboard";
import GenerosList from "./pages/GenerosList";
import DirectoresList from "./pages/DirectoresList";
import ProductorasList from "./pages/ProductorasList";
import TiposList from "./pages/TiposList";
import PeliculasList from "./pages/PeliculasList";

function App() {
  return (
    <Router>
      <Navbar />
      <div className="container mx-auto p-4">
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/generos" element={<GenerosList />} />
          <Route path="/directores" element={<DirectoresList />} />
          <Route path="/productoras" element={<ProductorasList />} />
          <Route path="/tipos" element={<TiposList />} />
          <Route path="/media" element={<PeliculasList />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
